        <script>
            function initMap()
            {
                var myLatLngs = [
                {
                    lat: 30.2926,
                    lng: -97.7474
                },
                {
                    lat: 30.2840,
                    lng: -97.7504
                },
                {
                    lat: 30.2787,
                    lng: -97.7302
                },
                {
                    lat: 30.2741,
                    lng: -97.7743
                }];
                var map = new google.maps.Map(document.getElementById('map'),
                {
                    zoom: 14,
                    center: myLatLngs[1]
                });
                var pinColor = "007569";
                var greenPinImage = new google.maps.MarkerImage("http://chart.apis.google.com/chart?chst=d_map_pin_letter&chld=%E2%80%A2|" + pinColor,
                    new google.maps.Size(21, 34),
                    new google.maps.Point(0, 0),
                    new google.maps.Point(10, 34));
                pinColor = "FF7500";
                var redPinImage = new google.maps.MarkerImage("http://chart.apis.google.com/chart?chst=d_map_pin_letter&chld=%E2%80%A2|" + pinColor,
                    new google.maps.Size(21, 34),
                    new google.maps.Point(0, 0),
                    new google.maps.Point(10, 34));
                var markers = [];
                var setup = function()
                {
                    var i, marker;
                    var lastIndex = 0;
                    var list = document.querySelector('[ni-control-id="226"]');
                    for (i = 0; i < myLatLngs.length; i++)
                    {
                        var marker = new google.maps.Marker(
                        {
                            position: myLatLngs[i],
                            map: map,
                            icon: redPinImage
                        });
                        markers.push(marker);
                    }
                    if (list !== null)
                    {
                        list.addEventListener('change', function(e)
                        {
                            markers[lastIndex].setMap(null);
                            markers[lastIndex] = new google.maps.Marker(
                            {
                                position: myLatLngs[lastIndex],
                                map: map,
                                icon: redPinImage
                            });
                            var index = list.selectedIndexes[0];
                            markers[index].setMap(null);
                            markers[index] = new google.maps.Marker(
                            {
                                position: myLatLngs[index],
                                map: map,
                                icon: greenPinImage
                            });
                            lastIndex = index;
                        });
                    }
                };
                if (document.readyState === 'complete' || document.readyState === 'loaded')
                {
                    setup();
                }
                else
                {
                    document.addEventListener('DOMContentLoaded', function()
                    {
                        setup();
                    })
                }
            }
        </script>
        <script async="" defer="" src="https://maps.googleapis.com/maps/api/js?key=AIzaSyCtaCR-h7RWgv4iRkkbKLfMZU83hmfhh_Y&callback=initMap">
